import { useState } from "react";
import { getMenuEfficiencyReport, getOrdersBetweenDates } from "../../api/orderApi";

function ManagerReport() {
  const [managerId, setManagerId] = useState("");
  const [title, setTitle] = useState("");
  const [menu, setMenu] = useState([]);
  const [orders, setOrders] = useState([]);

  const loadMenu = async () => {
    const data = await getMenuEfficiencyReport(managerId, title);
    setMenu(data);
  };

  const loadOrders = async () => {
    const data = await getOrdersBetweenDates("2025-01-01", "2025-12-31");
    setOrders(data);
  };

  return (
    <div>
      <h2>Manager Report</h2>

      <input
        placeholder="Manager ID"
        value={managerId}
        onChange={e => setManagerId(e.target.value)}
      /><br /><br />

      <input
        placeholder="Report Title"
        value={title}
        onChange={e => setTitle(e.target.value)}
      /><br /><br />

      <button onClick={loadMenu}>Menu Efficiency</button>
      <button onClick={loadOrders}>Orders</button>

      <h3>Menu Efficiency</h3>
      <table border="1">
        <thead>
          <tr>
            <th>Course</th>
            <th>Amount Sold</th>
          </tr>
        </thead>
        <tbody>
          {menu.map(m => (
            <tr key={m.courseName}>
              <td>{m.courseName}</td>
              <td>{m.amountSold}</td>
            </tr>
          ))}
        </tbody>
      </table>

      <h3>Orders</h3>
      <ul>
        {orders.map(o => (
          <li key={o.orderId}>
            #{o.orderId} – {o.orderPrice} ₺ – {o.date}
          </li>
        ))}
      </ul>
    </div>
  );
}

export default ManagerReport;
